            this.coreano7.Text = "한국어 스크립트\r\n\r\n\r\n기초\r\n\r\n\r\n한국 기록 시스템은 혼합 및 시작\r\n7 세기에 사용됩니다. C.는, 중국의 변경 인.\r\n15 세기에 개혁은" +
    " 서면으로 발생합니다.\r\n방향을 작성하는 것은 아래 시작에 위로부터입니다\r\n오른쪽. 이는 국내에서 사용되는 기록 시스템\r\n남.";
